public class Solution {
    public String[] move(String[] board) {
        // Write your solution here
        if (board == null || board.length < 2) return board;
        int len = board.length, idx = -1;
        for (int i = 0; i < len; i++) {
            if (!board[i].equals(".")) {
                idx++;
                board[idx] = board[i];
            }
        }
        while (idx + 1 < len) {
            board[++idx] = ".";
        }
        return board;
    }
}
